class TzPolygon {
  List<double> pts;

  TzPolygon(List<double> D) {
    pts = D;
  }

  bool contains(double testy, double testx) {
    bool inside = false;
    int n = pts.length;
    double yj = pts[n - 2];
    double xj = pts[n - 1];
    for (int i = 0; i < n;) {
      double yi = pts[i++];
      double xi = pts[i++];
      if (((yi > testy) != (yj > testy)) &&
          (testx < (xj - xi) * (testy - yi) / (yj - yi) + xi - 0.0001))
        inside = !inside;
      xj = xi;
      yj = yi;
    }
    return inside;
  }
}

